import React, { useEffect, useState } from 'react';
import axios from 'axios';
import ExerciseForm from './Components/ExerciseForm';
import ExerciseList from './Components/ExerciseList';
import OffcanvasExample from './Components/nav';
import 'bootstrap/dist/css/bootstrap.min.css';
import Swal from 'sweetalert2'
import withReactContent from 'sweetalert2-react-content'
import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Offcanvas from 'react-bootstrap/Offcanvas';

function App() {
  const [exercises, setExercises] = useState([]);
  const [currentExercise, setCurrentExercise] = useState(null);
  const MySwal = withReactContent(Swal)

  useEffect(() => {
    fetchExercises();
  }, []);

  const fetchExercises = () => {
    axios.get('https://localhost:7165/api/Ejercicio')
      .then(response => {setExercises(response.data.myObject); console.log(response.data.myObject)})
      .catch(error => console.error('Error:', error));

  };

  const handleEdit = (exercise) => {
    console.log(exercise);
    setCurrentExercise(exercise);
  };

  const handleDelete = (id,exercise) => {
     Swal.fire({
    title: `Estas Seguro de elimnar ${exercise.nombreEjecicio} ?`,
    text: "No se podra Recuperar!",
    icon: "warning",
    showCancelButton: true,
    confirmButtonColor: "#3085d6",
    cancelButtonColor: "#d33",
    confirmButtonText: "Si, Eliminar!"
  }).then((result) => {
    if (result.isConfirmed) {     
      axios.delete(`https://localhost:7165/api/Ejercicio/${id}`, {
      }).then(response => {
          MySwal.fire({
            icon: "success",
            title: `<a>Se ha Eliminado Correctamente </strong></a>`,
            showConfirmButton: false,
            timer: 2500
          })
          fetchExercises();
          clearCurrentExercise();
      }).catch(error => {
          console.error('Error en la petición:', error.response ? error.response.data : error);
          alert("Error en la solicitud. Revisa la consola para más detalles.");
      });
    }
  });

  };

  const clearCurrentExercise = () => {
    setCurrentExercise(null);
  };

  return (
    <div className="card text-center">

    <div className="card-header">
    {[false].map((expand) => (
        <Navbar key={expand} expand={expand} className="bg-body-tertiary mb-3">
          <Container fluid>
            <Navbar.Brand href="#">Menu</Navbar.Brand>
            <Navbar.Toggle aria-controls={`offcanvasNavbar-expand-${expand}`} />
            <Navbar.Offcanvas
              id={`offcanvasNavbar-expand-${expand}`}
              aria-labelledby={`offcanvasNavbarLabel-expand-${expand}`}
              placement="end"
            >
              <Offcanvas.Header closeButton>
                <Offcanvas.Title id={`offcanvasNavbarLabel-expand-${expand}`}>
                  Offcanvas
                </Offcanvas.Title>
              </Offcanvas.Header>
              <Offcanvas.Body>
                <Nav className="justify-content-end flex-grow-1 pe-3">
                  <Nav.Link href="#action1">Home</Nav.Link>
                  <Nav.Link href="#action2">Link</Nav.Link>
                  <NavDropdown
                    title="Dropdown"
                    id={`offcanvasNavbarDropdown-expand-${expand}`}
                  >
                    <NavDropdown.Item href="#action3">Action</NavDropdown.Item>
                    <NavDropdown.Item href="#action4">
                      Another action
                    </NavDropdown.Item>
                    <NavDropdown.Divider />
                    <NavDropdown.Item href="#action5">
                      Something else here
                    </NavDropdown.Item>
                  </NavDropdown>
                </Nav>
                <Form className="d-flex">
                  <Form.Control
                    type="search"
                    placeholder="Search"
                    className="me-2"
                    aria-label="Search"
                  />
                  <Button variant="outline-success">Search</Button>
                </Form>
              </Offcanvas.Body>
            </Navbar.Offcanvas>
          </Container>
        </Navbar>
      ))}
    </div>

          <ExerciseForm
            exerciseToEdit={currentExercise}
            refreshExercises={fetchExercises}
            clearEdit={clearCurrentExercise}
          />

          <ExerciseList
            exercises={exercises}
            onEdit={handleEdit}
            onDelete={handleDelete}
          />
      <div className="card-footer text-body-secondary">
        2 days ago
        </div>
    </div>
  );
}

export default App;
